Management of three specialist construction teams, totalling 30 employees; 
Subcontract negotiations and procurement drawing on knowledge of Conditions of Contract for Building and Civil Engineering standards; 
Cost reporting, forecasting and budgeting; 
Professional interaction with a wide variety of personnel: unskilled labour to senior management; and 
On-site union negotiation.

I gained valuable practical trade experience:


    Working in a team of skilled fitter-turners;


    General workshop experience;



      Making injection moulds and press tools.

general.description:
Associate lawyer in the Corporate practice group at Allens, focusing on mergers and acquisitions and head office advisory.

Recent transactional experience includes advising:

- Australia and New Zealand Banking Group Limited on the $2.85 billion sale of its life insurance business to Zurich;
- Australia and New Zealand Banking Group Limited on the $975 million sale of its pensions and investments business to IOOF;
- Capitol Health Limited on its off-market takeover bid for Integral Diagnostics Limited;
- Australian Venue Co. on its various pub and restaurant acquisitions;
- a major Australian listed company on corporate aspects of a regulatory investigation relating to disclosure;
- Future Fund Board of Guardians on its equity co-investment in Conviva Inc;
- RSPCA Australia on various corporate governance issues including director's duties;
- a consortium comprising Global Infrastructure Management, Canada Pension Plan Investment Board, CIC Capital Corporation, GIC Private Limited and British Columbia Investment Management Corporation on the $9.05 billion acquisition of Asciano;
- GoldLinQ on the procurement and delivery of the $420 million Gold Coast Light Rail (Stage 2) project.

